import React from 'react'
import './Sidebar.css';
import Logo from '../../imgs/logo.png'
import {UilEstate} from '@iconscout/react-unicons'
import { SidebarData } from '../../Data/Data';

export const Sidebar = () => {
    return (
        <div className='Sidebar'>
            <div className='logo'>
                <img src={Logo} alt="" />
                <span>Sh<span>op</span>s</span>
            </div>
            {/* Menu */}

            <div className='menu'>
             {SidebarData.map()}

            </div>


        </div>





    )
}
